{
    "id": 1345,
    "amsOccupationId": 303,
    "namn": "Brevbärare",
    "kortSammanfattning": "Ser till att posten kommer fram i tid och till rätt person, ett yrke för den som gillar högt tempo.",
    "sammanfattning": "Brevbärare arbetar med att sortera och dela ut post. Det är viktigt att posten kommer fram i tid och till rätt person. Därför måste brevbäraren vara bra på att hantera sin tid och kunna arbeta självständigt eftersom man ofta arbetar ensam. Utdelningen sker numera oftast i bil eller med moped, men ibland även med cykel eller till fots. Därför kan det vara bra att vara rörlig i jobbet.",
    "arbetsuppgifter": "Brevbärare börjar jobba tidigt på morgonen med att sortera dagens post. Därefter ger man sig ut på sin postrunda och delar ut posten. När posten från morgonen är utdelad återvänder man till kontoret för att sortera den del av morgondagens post som redan kommit. \n\nBrevbäraren delar ut post ensam och är ute i alla väder. Idag är det vanligast att man kör någon form av fordon, en bil eller moped när man delar ut posten. Därför är körkort ofta ett krav när man anställs. Men det är också vanligt att posten delas ut med hjälp av cykel eller genom att gå med en kärra, särskilt i tätorternas stadskärna. \n\nTill postterminalerna kommer post som ska sorteras för att fortsätta till olika delar av landet eller till olika utdelningsområden. Att ta hand om post som ska eftersändas ingår också i arbetet.\n\nPostsorterare organiserar posten före sortering och sköter brevsorteringsmaskinen. Det mesta av posten sorteras med hjälp av maskiner, men de brev som maskinen inte klarar av att hantera sorteras manuellt. Postsorterare kör truck när de lastar och lossar post.",
    "arbetsmiljo": "Arbetet kan innebära tunga lyft och man rör på sig mycket. Arbetet utförs delvis utomhus.",
    "arbetstid": "Brevbärare har fasta arbetstider. Det mesta sorteringsarbetet pågår eftermiddagar, kvällar och nätter. En postsorterare arbetar ofta på schemalagda arbetstider. Inom en del av de postdistributionsföretag kan arbetet även göras under helgen.",
    "arbetsplats": "",
    "internationellaMojligheter": null,
    "formagor": {
        "beskrivning": "Förmågor som brevbärare och postsorterare behöver ha eller utveckla",
        "detaljer": [
            {
                "text": "Brevbärare kan vara ett rörligt arbete, där det kan vara viktigt att ha en normal fysisk förmåga.",
                "kategori": "God fysik"
            },
            {
                "text": "Det är viktigt att kunna hålla koncentrationen och vara noggrann även när man arbetar under tidspress.",
                "kategori": "Koncentrationsförmåga"
            },
            {
                "text": "Det dagliga arbetet sker tidvis i högt tempo eftersom posten måste sorteras färdigt och delas ut i tid.",
                "kategori": "Stresstålighet"
            },
            {
                "text": "Kunna kombinera olika rörelser samtidigt är viktigt vid till exempel postsortering.",
                "kategori": "Koordinationsförmåga"
            },
            {
                "text": "Brevbärare och postsorterare behöver kunna producera tillfredsställande resultat på kort tid.",
                "kategori": "Resultatinriktad"
            }
        ]
    },
    "utbildningar": {
        "beskrivning": "Man måste ha fyllt 18 år för att arbeta som brevbärare. Den som ska köra ut post med bil eller moped behöver körkort.",
        "detaljer": [
            {
                "text": "",
                "kategori": "Inga krav på formell utbildning"
            }
        ]
    },
    "utbildningsvag": {
        "beskrivning": "Yrket har inga formella utbildningskrav, men det kan vara bra att ha gått en gymnasieutbildning.",
        "visaValideringstext": false,
        "utbildningsvagkategorier": [
            {
                "kategori": "Gymnasieutbildning",
                "kategoriText": "Ibland ställs krav på gymnasieutbildning som grund."
            },
            {
                "kategori": "Företagsförlagd utbildning",
                "kategoriText": "Brevbärare utbildas internt i samband med att de anställs."
            }
        ]
    },
