    "namn": "Ingenjörer och tekniker (3.f.)",
    "yrkesbeskrivning": "Ingenjörer och tekniker utför produktions- och materialplanering. Utför tekniskt arbete i samband med konstruktion, byggande, underhåll och reparation av byggnader och anläggningar. Organiserar och övervakar processer vid tillverkning och montering av el-, tele- och elektronikutrustning, maskiner och mekaniska installationer m.m. Provar och kontrollerar produkter. Utför annat tekniskt arbete. \n\nTekniker, bilddiagnostik och medicinteknisk utrustning installerar, kontrollerar, övervakar och utför service på medicinteknisk utrustning som används vid diagnosticering eller behandling av olika sjukdomar. Sköter och övervakar t.ex. hjärtlungmaskiner. \n\nLaboratorieingenjörer utför experiment, analys- och kontrollarbete vid kemisk och fysikaliskt industri- eller forskningslaboratorium. Kontrollerar, testar och analyserar råvaror och produkter. Assisterar vid utformning och utförande av experiment.\n\nCivilingenjörsyrken ingår inte i den här yrkesgrupperingen.",
    "karnaktivitet": "Att med utgångspunkt från givna teoretiska regler och metoder, omsätta dessa kunskaper till exempelvis rutiner, metoder och konstruktioner.",
    "statistik": "Gruppen omfattar cirka 105 000 förvärvsarbetande varav 20 % är kvinnor och 80 % är män.",
