    "yrkesomrade": "3 Yrken med krav på högskolekompetens eller motsvarande",
    "kritiskFaktor": "Förmågan att, normalt på egen hand, driva analytiskt krävande tekniska processer samt över tid upprätta hålla engagemanget för detta, är avgörande krav.",
    "relateradeICFKoder": [
        "d220 Att företa mångfaldiga uppgifter",
        "d398 Kommunikation, annan specificerad",
        "d399 Kommunikation, ospecificerad"
    ],
    "toleransMotAktivitetsbegransning": "Bedömd tolerans för fysiska funktioner är måttlig till stor. Detta innebär inte att individer med stora fysiska besvär med självklarhet kan antas klara arbetet. Bedömningar måste göras bl.a. utifrån individens specifika förutsättningar och de anpassningsmöjligheter som kan antas vara rimliga i ett normalt förekommande arbete.",
    "fysiskaFunktioner": {
        "beskrivning": "Vissa individer inom yrkeskategorin kan utveckla besvär i nacke och axlar av så kallat repetitivt bildskärmsarbete men yrkeskategorin hör, enligt Arbetsmiljöverket, inte till någon högriskgrupp för att drabbas av problem i nacke och axlar.",
        "toleranser": [
            {
                "beskrivning": "Arbetsuppgifterna utförs i huvudsak sittandes eller ståendes, möjlighet till omväxlande arbetsställningar finns. Arbetet innehåller både kontorsarbete vid dator eller ritbord där yrkesutövare gör analyser, utredning m.m. samt arbetsplatsbesök som innehåller moment som mätning, provtagning o.s.v. Arbetet är fysiskt lätt och innehåller få tunga lyft.",
                "min": 2,
                "max": 3
            },
            {
                "beskrivning": "Vissa inriktningar innehåller mer konstruktionsskapande och innebär statiskt arbete vid datorarbetsplats.",
                "min": 2,
                "max": 3
            }
        ]
    },
    "synHorselTal": {
        "beskrivning": "",
        "toleranser": [
            {
                "beskrivning": "Syn, främst på nära håll, är av betydelse vid t.ex. datorarbete och liknande. Att se, både på nära och långt håll är av vikt, dels vid datorarbete och för att upptäcka detaljer och dels ute på en arbetsplats när yrkesutövare genomför mätningar o.s.v. Många av de arbetsredskap som finns att tillgå kräver också avläsning på display.",
                "min": 1,
                "max": 1
            },
            {
                "beskrivning": "De flesta arbetsuppgifterna innebär kontakt med kunder och innebär att yrkesutövare måste kunna skilja ljud från varandra, höra vad kollegor och kunder säger.",
                "min": 1,
                "max": 1
            },
            {
                "beskrivning": "Arbetet sker ofta i samarbete med andra yrkesgrupper och förutsätter god kommunikativ förmåga. Det är viktigt att kunna tala klart och tydligt så att andra hör och förstår vad som sägs.",
                "min": 1,
                "max": 1
            }
        ]
    },
    "balansKoordinationFinmotoriskKvalitet": {
        "beskrivning": "",
        "toleranser": [
            {
                "beskrivning": "Ingenjörer och tekniker utför finmotoriskt arbete med framför allt händer och fingrar (t.ex. arbete med dator och penna). Ibland krävs total precision (t.ex. vid arbete med dator eller vid mätningar, konstruktionsritningar etc.). I vissa yrkesinriktningar ingår fältarbete, ibland i kuperad terräng vilket inbegriper grundläggande kroppsbalans. Att arbeta vid arbetsplatser med mätning, provtagning och besiktning förekommer vilket också kräver grundläggande kroppsbalans.",
                "min": 1,
                "max": 2
            }
        ]
    },
    "psykiskaFunktioner": {
        "beskrivning": "Arbetssjukdomar orsakas oftast av organisatoriska/sociala faktorer som exempelvis högt arbetstempo vilket kan leda till stress.",
        "toleranser": [
            {
                "beskrivning": "Arbetsuppgifterna bygger på att utifrån ett givet material eller förutsättningar kunna identifiera och ta fram lösningar på problem som existerar inom verksamhetsområdet. Yrkesutövare måste ha förmåga att se detaljer och ha kunskap om hur dessa påverkar helheten. Yrkesutövare tar ofta fram ritningar och utredningar och det är därför av vikt att kunna uttrycka sig på ett sätt så att andra kan förstå och omsätta innehållet till praktiska lösningar.",
                "min": 1,
                "max": 1
            },
            {
                "beskrivning": "Att arbeta som ingenjör eller tekniker innebär att yrkesutövaren driver processer från konstruktionsskiss till färdigställande. Det gäller att utifrån givna metoder och regler snabbt kunna skifta fokusområde eller anpassa sig till nya omständigheter och oförutsedda händelser, t.ex. vid konstruktionsfel.",
                "min": 1,
                "max": 1
            },
            {
                "beskrivning": "Arbetet innebär att ta fram information till konstruktioner och ställer därför stora krav på att yrkesutövare kan uttrycka sig väl i tal och skrift så att andra förstår. Arbetet bedrivs i nära relation med andra yrkesgrupper och ställer vissa krav på att yrkesutövare kan upprätthålla mellanmänskliga relationer över tid samt vara emotionellt stabil och kunna samarbeta med andra (vara lyhörd för andras synpunkter, viljeyttringar etc.). Ofta handlar det om att ha en expertfunktion som går ut på att skapa lösningar efter beställningar från personer som saknar den kompetensen och har svårt att se och förstå problem, förutsättningar och möjligheter i relation till det mål beställaren själv har.",
                "min": 1,
                "max": 2
            },
            {
                "beskrivning": "Arbetet är relativt omväxlande och tillåter regelbundna raster/pauser. Ofta krävs att arbetsuppgifter skall utföras inom en viss deadline och har betydelse för andra yrkesgrupper, vilket gör att arbetet ofta sker under tidspress. Följaktligen är det av vikt att kunna upprätthålla koncentration och fokus under en hel arbetsdag.",
                "min": 1,
                "max": 1
            }
        ]
    },
