    "externGranskning": "Extern granskning (2017-2018) \n\nUnionen, Julia Tchibrikova, statistiker \n\nKommentar till extern granskning \n\n2018-02-01: Unionen har lämnat synpunkt att det inom gruppen ingenjörer och tekniker finns underkoder som kan ha en något annorlunda kravbild än övriga yrken inom grupperingen, t.ex. geologer och geotekniker samt bergtekniker. Detta ger skäl till extra försiktighet vid tolkningen.\n\nFotnot om ICF-koderna   \n\nICF-koden d398: saknas i AFU-manualen men finns i Socialstyrelsens ICF-kodregister \"Koder för funktionstillstånd ICF 2017\".",
